--
-- Table structure for table `corrections`
--

DROP TABLE IF EXISTS `corrections`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `corrections` (
  `id` int unsigned NOT NULL AUTO_INCREMENT COMMENT 'Идентификатор правки',
  `str_number` int unsigned NOT NULL COMMENT 'Номер строки',
  `old_str` text CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL COMMENT 'Старый текст',
  `new_str` text CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL COMMENT 'Новый текст',
  `user_id` int unsigned NOT NULL COMMENT 'Ссылка на пользователя, который внес правку',
  `is_deleted` tinyint(1) NOT NULL DEFAULT '0' COMMENT 'Признак отмены',
  PRIMARY KEY (`id`),
  KEY `corrections_user_id_fk` (`user_id`),
  CONSTRAINT `corrections_user_id_fk` FOREIGN KEY (`user_id`) REFERENCES `users` (`id`) ON DELETE RESTRICT
) ENGINE=InnoDB AUTO_INCREMENT=211 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci COMMENT='Таблиц правок';
/*!40101 SET character_set_client = @saved_cs_client */;

